const SCHEDULE_MAX = 25;
let schedule = {};
schedule.getList$ = () =>{
	let results = {};
	let ALL_SCHEDULES = schedule.getAllSchedules();
	results.workouts = JSON.parse(ALL_SCHEDULES)
						.map((klass) => {
							klass.instructor_video_id = 1;
							return klass;
						});	
	return Observable.of(JSON.parse(ALL_SCHEDULES));
};

schedule.getListById$ = (id) =>{
	let results = {};	
	//let n = (id % 2 == 0) ? 1 : 2;
	results.workouts = schedule.getFiltered(id);
	return Observable.of(results);	
};

// This function gets called directly from the /home API
// Mobile calls this one
schedule.getListByDate$ = (d) =>{
	let results = {};
	let user_created_at = d.user_date;
	let schedule_test_id = d.test;
	let id = schedule.getWeekId(user_created_at,schedule_test_id);
	//let n = (id % 2 == 0) ? 1 : 2;
	results.workouts = schedule.getFiltered(id,schedule_test_id);
	return Observable.of(results);	
};

schedule.getFiltered = (id, test ="ALL_SCHEDULES_TEST_A") => {
	
	
	return JSON.parse(schedule.getAllSchedules(test))		
						.filter((el) => {return (el.schedule_id == id) })												
						.map((klass, index) => {							
							klass.duration = schedule.getActualTime(klass.audio_time);
							if (index % 2 == 0){
								klass.instructor_video_id = 1;
								klass.instructor_video_name = "Jodi Brinkman";
							}else{								
								klass.instructor_video_id = 4;
								klass.instructor_video_name = "Laura Locker";
							}
							return klass;
						});	
}

schedule.getActualTime = (klass_seconds) => {
	return Math.floor(klass_seconds / 60) + " min";
}

schedule.getAllSchedules = (test) => {
	let schedule = ALL_SCHEDULES_A;
	if (test == "ALL_SCHEDULES_TEST_B"){
		schedule = ALL_SCHEDULES_B
	}
	return schedule;
}

schedule.getWeekId = (userDate,test ="ALL_SCHEDULES_TEST_A") => {
	if ( test == 'ALL_SCHEDULES_TEST_B'){
		return 0;
	}
	let id = 1;
	
	try{
		let created_at = new Date(userDate);	
		console.log(`USER TRACKING INFO CREATED_AT:`, created_at);
		let cutoff_date = new Date("2020-09-02T00:00:00.000Z");
		
	    if ( created_at > cutoff_date){
	        cutoff_date = created_at;
		}	   
		//console.log("user date - cutoff_date", cutoff_date);
	    let today = new Date();    
	    let weeksBtw = Math.floor(Math.abs(cutoff_date.getTime() - today.getTime()) / (1000 * 60 * 60 * 24 * 7));
		console.log("USER TRACKING INFO SCHEDULE WEEK", weeksBtw);	   
	    if ((weeksBtw) && ( weeksBtw > SCHEDULE_MAX )){
	        id = weeksBtw % SCHEDULE_MAX;
	    }else{
	        id = weeksBtw;
	    }

	    if(id == 0){
	    	id = 1;
	    };	   	    
	    return id;

	}catch(error){
		console.log("ERROR GETTING WEEK ID FOR SCHEDULE, RETURN DEFAULT", error);
		return 1;
	}
}



module.exports = schedule;
